class Solution:
    def numTeams(self, rating: List[int]) -> int:
        n = len(rating)
        temp = [(i, v) for i, v in enumerate(rating)]
        temp.sort(key=lambda x: x[1])
        temp2 = temp[:]

        def find(k):
            x = 0
            while temp[k][1] != temp[x][1]:
                x += 1
            return x

        def find2(k):
            x = 0
            while temp2[k][1] != temp2[x][1]:
                x += 1
            return x

        ans = 0
        for i, v in enumerate(rating):
            l = []
            r = []
            for j, u in enumerate(rating):
                if i != j:
                    if u < v:
                        l.append((find(j), u))
                    elif u > v:
                        r.append((find2(j), u))
            l.sort()
            r.sort()
            l2 = []
            r2 = []
            for j, u in enumerate(rating):
                if i != j:
                    if u < v:
                        l2.append((find(j), u))
                    elif u > v:
                        r2.append((find2(j), u))
            l2.sort()
            r2.sort()
            for j, w in l:
                for k, z in r2:
                    ans += 1
            for j, w in r:
                for k, z in l2:
                    ans += 1
        return ans
